import React from "react";
import {Routes,Route} from 'react-router-dom';
import Home from "./src/pages/Home";

const AllRoutes = () =>{
    return(
        <Routes>
            <Route exact path="/" element={<Home/>}/>
        </Routes> 
    )
}

export default AllRoutes;
